  \"2015-05-21T23:17:09.154560\",\n\t\"name\": \"vista-evolution-program-plan\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"'The Department of Veterans Affairs (VA)
  and the Department of Defense (DoD) are working together to fundamentally and positively
  impact the health outcomes of Veterans, Service members, and their dependents. Achieving
  interoperability of health records between the two Departments is the chief goal
  motivating the Departmentsu00efu00bfu00bd electronic health record (EHR) efforts.
  Seamless integration of health data from VA, DoD, and other healthcare partners
  enables clinicians and patients to benefit from the availability of a complete longitudinal
  health record, achieving the goal of developing electronic records that will transition
  along with them from active-duty to retired status.rnThe Departments are on complementary
  paths for modernizing their respective EHR systems, replacing or enhancing existing
  systems as required to support delivery of the best possible care in their particular
  environments. For its part, VA will enhance, or evolve, its Veterans Health Information
  Systems and Technology Architecture (VistA) EHR to achieve its interoperability,
  clinical, and technical objectives. This VistA Evolution Program Plan captures VAu00efu00bfu00bds
  structured approach to executing this mission.'\",\n\t\"license_title\": \"U.S.
